import React, {SetStateAction, useEffect, useState} from "react";
import cn from "classnames";


interface Props {
    setType : React.Dispatch<SetStateAction<string>>,
    type : string
}
export default function HeadButton({ setType, type} : Props){
    const [cheked, setChecked] = useState(type);
    const handleChange = (ev: React.MouseEvent<HTMLButtonElement>) => {
        console.log(ev)
        setType(type);
    };
    return (
        <div className='head_button_group'>
            <button  id={'01'} className={cn('header_button')} onClick={handleChange}>마이체크업</button>
            <button  id={'02'} className={cn('header_button')} onClick={handleChange}>벨류맵</button>
        </div>
    )
}
